import React from "react"
import { Document, Page } from "react-pdf"
import filePDF from '../src/pdf/CV-Developer.pdf'

class Test extends React.Component {

    render() {
        return (
        <Document
            file={{
            url: filePDF
            }}
            onLoadError={e =>
            console.log("Error while loading document! " + e.message)
            }
            onSourceError={e =>
            console.log("Error while loading document! " + e.message)
            }
        >
            <Page pageNumber={1} />
        </Document>
        );
    }
}

const Resume = () => {
  return (
    <div>
      <Test></Test>
    </div>
  );
};

export default Resume
